\"}',1,'2022-07-12 12:36:57','2022-07-12 12:50:41'),(2415351484,'user',2,2,'Checkout mother fucker','{\"new_name\":\"7aa6e48e-41a4-4d8f-a78d-dc2d9d442f83.jpeg\",\"old_name\":\"Murphey-Web.jpeg\"}',1,'2022-07-11 15:16:37','2022-07-11 15:16:39'),(2419323055,'user',3,1,'Easy workflow\r\nduring the lessons.\r\nDisplay the metronome, audio player and your sheet music directly in the teaching window, and easily remote control your students&rsquo; experience with one click. That&rsquo;s right: You remote-control the tools on your students&rsquo; screens &ndash; as if by magic. Just like in face-to-face lessons, you are in command.\r\n\r\nYou don&rsquo;t need to explain how to operate external apps. And all tools are available to your students even after class! This way, they are also optimally supported during practice long after the lesson.',NULL,1,'2022-07-11 16:10:33','2022-07-11 16:10:34'),(2423650398,'user',86,86,'I want to do payment so which reference must I use ??,',NULL,1,'2023-02-03 06:50:20','2023-02-03 06:53:23'),(2448303109,'user',1,3,'All of it?',NULL,1,'2022-07-11 16:08:20','2022-07-11 16:08:22'),(2476919397,'user',3,1,'nani sir',NULL,1,'2022-07-11 16:02:23','2022-07-11 16:02:25'),(2479317149,'user',1,3,'Dhodhi',NULL,1,'2022-07-11 16:01:25','2022-07-11 16:01:27'),(2490810006,'user',3,1,'hello',NULL,1,'2022-07-11 15:54:27','2022-07-11 15:59:48'),(2504241859,'user',4,2,'gokreg',NULL,1,'2022-07-11 15:26:43','2022-07-11 15:34:55'),(2504485150,'user',4,2,'allan',NULL,1,'2022-07-12 09:36:40','2022-07-25 20:25:14'),(2536376715,'user',3,1,'ok',NULL,1,'2022-07-11 16:01:29','2022-07-11 16:01:32'),(2546993610,'user',3,1,'heee',NULL,1,'2022-07-11 16:05:57','2022-07-11 16:05:59'),(2573004379,'user',3,1,'s musicians, we know how important sound quality is. Each of us knows how much work is needed on our own instrument to sound the way we sound. In order to make sound details audible online as well, we paid special attention to sound quality when developing doozzoo. This m